import React from "react";
import { Link } from "react-router-dom";

const Houses = () => {
  return (
    <>
      <h1>Hogwarts Houses</h1>
      <ul>
        <li>
          <Link to="/house/gryffindor">
            <img
              src="https://static.wikia.nocookie.net/harrypotter/images/9/98/Gryffindor.jpg/revision/latest?cb=20110503103732"
              alt=""
            />
          </Link>
        </li>
        <li>
          <Link to="/house/hufflepuff">Hufflepuff</Link>
        </li>
        <li>
          <Link to="/house/ravenclaw">Ravenclaw</Link>
        </li>
        <li>
          <Link to="/house/slytherin">Slytherin</Link>
        </li>
      </ul>
    </>
  );
};

export default Houses;
